from functools import reduce
import math

class Solution:
    def productExceptSelf(self, nums: list[int]) -> list[int]:
        zero_count =  nums.count(0)
        if zero_count > 1:
            return [0] * len(nums)
        result = []
        if 0 in nums:
            temp = nums.copy()
            temp.remove(0)
            product_without_zero = math.prod(temp)
        else:
            product_without_zero = math.prod(nums)
        for num in nums:
            if zero_count and num == 0:
                result.append(product_without_zero)
            elif zero_count and num != 0:
                result.append(0)
            else:
                result.append(product_without_zero//num)
        return result
        # prod, zero_cnt = reduce(lambda a, b: a*(b if b else 1), nums, 1), nums.count(0)
        # if zero_cnt > 1: return [0]*len(nums)
        # for i, c in enumerate(nums):
        #     if zero_cnt: nums[i] = 0 if c else prod
        #     else: nums[i] = prod // c
        # return nums
    
